Promise.all([
  fetch(`https://friends.roblox.com/v1/users/${currentUserId}/friends/online`, { credentials: "include" }).then(r => r.json()),
  fetch(`https://friends.roblox.com/v1/users/${currentUserId}/friends`, { credentials: "include" }).then(r => r.json())
]).then(async ([onlineData, allFriendsData]) => {

  const friendsMap = new Map(allFriendsData.data.map(f => [f.id, f]));

  let friendsToShow = onlineData.data.map(f => {
    const standardData = friendsMap.get(f.id);
    let iconClass = "";
    switch(f.userPresence?.UserPresenceType) {
      case "InStudio": iconClass = "icon-studio"; break;
      case "InGame": iconClass = "icon-game"; break;
      case "Website": iconClass = "icon-online"; break;
    }

    return {
      id: f.id,
      name: standardData?.name,
      lastLocation: f.userPresence?.lastLocation,
      placeId: f.userPresence?.placeId,
      iconClass
    };
  });

  if (friendsToShow.length < 10) {
    const onlineIds = new Set(friendsToShow.map(f => f.id));
    const offlineFill = allFriendsData.data
      .filter(f => !onlineIds.has(f.id))
      .slice(0, 10 - friendsToShow.length)
      .map(f => ({
        id: f.id,
        name: f.name,
        lastLocation: null,
        placeId: null
      }));
    friendsToShow.push(...offlineFill);
  }

  const container = document.querySelector(".friend-list");
  container.innerHTML = "";

  const thumbPromises = friendsToShow.map(friend =>
    fetch(`https://thumbnails.roblox.com/v1/users/avatar?userIds=${friend.id}&size=150x150&format=Png&isCircular=false`, { credentials: "include" })
      .then(r => r.json())
      .then(data => data.data[0]?.imageUrl || "")
  );

  const thumbnails = await Promise.all(thumbPromises);

  friendsToShow.forEach((friend, index) => {
    const li = document.createElement("li");
    li.id = `friend_${friend.id}`;
    li.className = "list-item friend";

    li.innerHTML = `
      <div class="avatar-container">
        <a href="https://www.roblox.com/users/${friend.id}/profile"
           class="avatar avatar-card-fullbody friend-link"
           title="${friend.name}">
          <span class="avatar-card-link friend-avatar">
            <img alt="${friend.name}" class="avatar-card-image" src="${thumbnails[index]}">
          </span>
          <span class="text-overflow friend-name">${friend.name}</span>
        </a>
        ${friend.lastLocation && friend.iconClass ?
          `<a class="friend-status place-link" href="https://www.roblox.com/games/refer?PlaceId=${friend.placeId}">
             <span class="avatar-status ${friend.iconClass}" title="${friend.lastLocation}"></span>
           </a>`
         : ""}
      </div>
    `;
    container.appendChild(li);
  });
});
