function initPopover(triggerSelector, contentSelector) {
  const trigger = document.querySelector(triggerSelector);
  if (!trigger) return;

  $(trigger).popover({
    html: true,
    container: 'body',
    content: function() {
      return document.querySelector(contentSelector).innerHTML;
    },
    placement: 'bottom',
    trigger: 'manual' // we'll handle toggle ourselves
  });

  $(trigger).on('click', function (e) {
    e.preventDefault();

    $('[data-toggle="popover"]').not(this).each(function() {
      $(this).popover('hide');
    });

    $(this).popover('toggle');
  });
}

initPopover('#navbar-setting a[data-toggle="popover"]', '#navbar-setting .rbx-popover-content');
initPopover('#navbar-robux a[data-toggle="popover"]', '#navbar-robux .rbx-popover-content');

$(document).on('click', function (e) {
  if (!$(e.target).closest('[data-toggle="popover"], .popover').length) {
    $('[data-toggle="popover"]').popover('hide');
  }
});
